transforms.result:
.boxes {
    display: flex;
    flex-direction: row;
    justify-content: center;
    margin-top: 5rem;
    margin-bottom: 10rem;
    gap: 6rem;


    .box {
        display: flex;
        flex-direction: column;
        border: solid black 2px;
        padding: 1rem 3rem 2rem 1rem;
        width: 27rem;

        .icons2 {
            padding-top: 8rem;
            gap: 0.5rem;
        }

        .icons3 {
            padding-top: 3rem;
            gap: 0.5rem;
        }
    }

    h3 {
        font-size: 2rem;
        font-weight: 300;
    }

    p {
        margin-top: 0.5rem;
        font-size: 1.5rem;
        width: 25rem;
    }

    .img {
        width: 25rem;
        height: 11.5rem;
        margin-top: 1rem;
    }

    .img2 {
        width: 25rem;
        height: 8rem;
        margin-top: 1rem;
    }

    .icons1, .icons2, .icons3 {
        display: flex;
        
        img {
            transition: all 0.3s ease-in-out;
            width: 3rem;
            height: 3rem;
            margin-top: 2rem;

            &:hover {
                transform: scale(1.2);
                cursor: pointer;
            }
        }
    }
}
